import React, { useState } from "react";


export default function Apps(){


    const [value , setvalue] = useState(0)

    function increment(){
        setvalue(prevcount => prevcount + 1)
    }
    function decrement(){
        setvalue(prevcount => prevcount - 1)
    }


    return(
        <>
        <button onClick={increment} >+</button>
        <h1>{value}</h1>
        <button onClick={decrement}>-</button>
        </>
    )

}
